INSERT INTO `holidays` VALUES (1,'New Year\'s Day','New Yearâ€™s Day is celebrated many countries such as in India on the January 1 in the Gregorian calendar.',' \'2020-01-01\''),(2,'Guru Govind Singh Jayanti','Guru Gobind Singh Jayanti is the Sikh annual celebration that occurs in countries such as India around December or January in the Gregorian calendar.',' \'2020-01-02\''),(3,'Lohri','Lohri is a restricted holiday in India',' \'2020-01-14\''),(4,'Pongal','Many southern states in India, particularly Tamil Nadu, celebrate Pongal as a thanksgiving for the good harvest season in mid-January every year.',' \'2020-01-15\''),(5,'Makar Sankranti','Makar Sankranti is a restricted holiday in India',' \'2020-01-15\''),(6,'Chinese New Year','Chinese New year is an annual global celebration in many countries including India.',' \'2020-01-25\''),(7,'Republic Day','India\'s Republic Day marks the anniversary of the adoption of the Indian constitution. It is an annual gazetted holiday in India on January 26.',' \'2020-01-26\''),(8,'Vasant Panchami','Vasant Panchami, or Indiaâ€™s spring festival, is a Hindu event that includes special rituals and highlights the start of spring.',' \'2020-01-30\''),(9,'Guru Ravidas Jayanti','Guru Ravidas Jayanti is a restricted holiday in India',' \'2020-02-09\''),(10,'Valentine\'s Day','Valentineâ€™s Day is celebrated in many places worldwide, including in India, on February 14 each year.',' \'2020-02-14\''),(11,'Maharishi Dayanand Saraswati Jayanti','Maharishi Dayanand Saraswati Jayanti is a restricted holiday in India',' \'2020-02-18\''),(12,'Shivaji Jayanti','Shivaji Jayanti is a restricted holiday in India',' \'2020-02-19\''),(13,'Maha Shivaratri/Shivaratri','Maha Shivaratri is an annual Hindu festival that is dedicated to Lord Shiva on the 13th or 14th day of the Hindu month of Maagha or Phalguna.',' \'2020-02-21\''),(14,'Holika Dahana','Holika Dahana is a restricted holiday in India',' \'2020-03-09\''),(15,'Hazarat Ali\'s Birthday','Hazarat Ali\'s Birthday is a restricted holiday in India',' \'2020-03-09\''),(16,'Holi','Holi is a spring festival of colors celebrated by Hindus, Sikhs and others. It celebrates the triumph of good over evil and the upcoming season of spring. The festival can last up to sixteen days.',' \'2020-03-10\''),(17,'March Equinox','March Equinox in India (New Delhi)',' \'2020-03-20T09'),(18,'Chaitra Sukhladi','Chaitra Sukhladi is a restricted holiday in India',' \'2020-03-25\''),(19,'Rama Navami','Rama Navami is a Hindu festival that celebrates the birth of Rama, the first son of King Dasaratha of Ayodhya.',' \'2020-04-02\''),(20,'Mahavir Jayanti','Mahavir Jayanti is a gazetted holiday in India',' \'2020-04-06\''),(21,'First day of Passover','During Passover, the Jewish people remember the liberation of the Israelites from slavery, their exodus from Egypt, and that their first-born children were spared during the 10th plague, as told in the Haggadah.',' \'2020-04-09\''),(22,'Maundy Thursday','Maundy Thursday is a Christian observance on the Thursday during Holy Week. It is the day before Good Friday.',' \'2020-04-09\''),(23,'Good Friday','Many Christians commemorate Jesus Christâ€™s crucifixion and death on Good Friday. It is a gazetted holiday in India.',' \'2020-04-10\''),(24,'Easter Day','Easter Sunday commemorates Jesus Christâ€™s resurrection, according to Christian belief.',' \'2020-04-12\''),(25,'Vaisakhi','Vaisakhi, also known as Baisakhi, is a harvest celebration on either April 13 or April 14 in the Gregorian calendar. It is one of Indiaâ€™s most notable celebrations.',' \'2020-04-13\''),(26,'Mesadi/Vaisakhadi','Mesadi/Vaisakhadi is a restricted holiday in India',' \'2020-04-14\''),(27,'Ambedkar Jayanti','Ambedkar Jayanti is a observance in India',' \'2020-04-14\''),(28,'May Day','May Day, or Labor Day, is a day off for workers in many countries around the world.',' \'2020-05-01\''),(29,'Buddha Purnima/Vesak','Vesak, also known as Buddha Purnima, celebrates of Gautama Buddha\'s birth, enlightenment and death.',' \'2020-05-07\''),(30,'Birthday of Ravindranath','Birthday of Ravindranath is a restricted holiday in India',' \'2020-05-07\''),(31,'Mother\'s Day','Motherâ€™s Day celebrates the achievements and efforts of mothers and mother figures.',' \'2020-05-10\''),(32,'Jamat Ul-Vida','Jamat Ul-Vida is a restricted holiday in India',' \'2020-05-22\''),(33,'Ramzan Id/Eid-ul-Fitar','Eid-al-Fitr is a holiday to mark the end of the Islamic month of Ramadan, during which Muslims fast during the hours of daylight.',' \'2020-05-25\''),(34,'Ramzan Id/Eid-ul-Fitar','One day of Eid-ul-Fitar, which marks the end of Ramadan, is a gazetted holiday in India.',' \'2020-05-25\''),(35,'June Solstice','June Solstice in India (New Delhi)',' \'2020-06-21T03'),(36,'Father\'s Day','Fatherâ€™s Day celebrates fatherhood and male parenting on different dates worldwide.',' \'2020-06-21\''),(37,'Rath Yatra','Rath Yatra is a restricted holiday in India',' \'2020-06-23\''),(38,'Guru Purnima','Guru Purnima is a festival that honors spiritual Gurus by remembering their life and teachings. It is observed on the full moon day, Purnima, in the Hindu month of Ashadh, which is usually June or July.',' \'2020-07-05\''),(39,'Bakr Id/Eid ul-Adha','Many Muslims in India celebrate Eid al-Adha (Id-ul-Zuha or Bakr-Id), which is on the 10th to 13th days of the Islamic month of Dhul Hijja.',' \'2020-07-31\''),(40,'Friendship Day','Friendship Day is a observance in India',' \'2020-08-02\''),(41,'Raksha Bandhan (Rakhi)','Raksha Bandhan is a Hindu festival that is celebrated on the full moon of the Hindu month of Shravana (Shravan Poornima). The day is also sometimes referred to as Brother and Sister Day because it honors the relationship between brother and sister.',' \'2020-08-03\''),(42,'Janmashtami (Smarta)','Janmashtami (Smarta) is a restricted holiday in India',' \'2020-08-11\''),(43,'Janmashtami','Krishna Janmashtami is a Hindu festival that celebrates the birth of Krishna, the eighth incarnation of the god Vishnu. It is celebrated on the eighth day of the Hindu month of Bhadrava (Bhadrapada), which is usually in August or September.',' \'2020-08-12\''),(44,'Independence Day','India\'s Independence Day is an annual gazetted holiday on August 15 to commemorate the day India became an independent nation.',' \'2020-08-15\''),(45,'Parsi New Year','Parsi New Year is a restricted holiday in India',' \'2020-08-16\''),(46,'Ganesh Chaturthi/Vinayaka Chaturthi','Ganesh Chaturthi is the great Ganesha festival that celebrates the birthday of Lord Ganesha during the Hindu Month of Bhadra, which usually falls between mid-August and mid-September. It is also known as Vinayaka Chaturthi and can last up to 10 days.',' \'2020-08-22\''),(47,'Muharram/Ashura','Muharram, or the Islamic New Year, is a public holiday in India.',' \'2020-08-29\''),(48,'Onam','Onam is a restricted holiday in India',' \'2020-08-31\''),(49,'September Equinox','September Equinox in India (New Delhi)',' \'2020-09-22T19'),(50,'Mahatma Gandhi Jayanti','Mahatma Gandhi\'s birthday is an annual gazetted holiday in India on October 2.',' \'2020-10-02\''),(51,'Maha Saptami','Maha Saptami is a restricted holiday in India',' \'2020-10-22\''),(52,'Maha Ashtami','Maha Ashtami is a restricted holiday in India',' \'2020-10-23\''),(53,'Maha Navami','Maha Navami is a restricted holiday in India',' \'2020-10-24\''),(54,'Dussehra','Dussehra, also known as Vijaya Dashami, is an Indian festival that celebrates good forces over evil forces. It spans for 10 days and is celebrated in varied traditions across India.',' \'2020-10-25\''),(55,'Milad un-Nabi/Id-e-Milad','Milad un-Nabi is a gazetted holiday in India and marks the Prophet Muhammad\'s birthday.',' \'2020-10-29\''),(56,'Halloween','Halloween is a festive occasion that is celebrated in many countries on October 31 each year.',' \'2020-10-31\''),(57,'Maharishi Valmiki Jayanti','Maharishi Valmiki Jayanti is a restricted holiday in India',' \'2020-10-31\''),(58,'Karaka Chaturthi (Karva Chauth)','Karwa Chauth is an annual one-day festival that honors the Hindu god Shiva and goddess Parvati. It is celebrated by all married Hindu women on the fourth day after the full moon in the Hindu month of Kartik, which is usually in October.',' \'2020-11-04\''),(59,'Naraka Chaturdasi','Naraka Chaturdasi is a restricted holiday in India',' \'2020-11-14\''),(60,'Diwali/Deepavali','Diwali is a festival of physical and spiritual light celebrated in October or November each year.',' \'2020-11-14\''),(61,'Govardhan Puja','Govardhan Puja is a restricted holiday in India',' \'2020-11-15\''),(62,'Bhai Duj','Bhai Duj is a Hindu festival that celebrates the relationship between a brother and a sister on the second day after the new moon in the Hindu month of Kartika.',' \'2020-11-16\''),(63,'Chhat Puja (Pratihar Sashthi/Surya Sashthi)','Chhat Puja (Pratihar Sashthi/Surya Sashthi) is a restricted holiday in India',' \'2020-11-20\''),(64,'Guru Tegh Bahadur\'s Martyrdom Day','Guru Tegh Bahadur\'s Martyrdom Day is a restricted holiday in India',' \'2020-11-24\''),(65,'Guru Nanak Jayanti','Guru Nanak Jayanti is a gazetted holiday in India',' \'2020-11-30\''),(66,'First Day of Hanukkah','Hanukkah, also known as Chanukah or the Festival of Lights, is celebrated for 8 days between the 25th day of the month of Kislev to the second day of Tevet in the Hebrew calendar.',' \'2020-12-11\''),(67,'Last day of Hanukkah','Hanukkah, also known as Chanukah or the Festival of Lights, is celebrated for eight days between the 25th day of the month of Kislev to the second day of Tevet in the Hebrew calendar.',' \'2020-12-18\''),(68,'December Solstice','December Solstice in India (New Delhi)',' \'2020-12-21T15'),(69,'Christmas Eve','Christmas Eve is the day before Christmas Day and falls on December 24 in the Gregorian calendar.',' \'2020-12-24\''),(70,'Christmas','Many Christians celebrate Christmas Day, which is a gazetted holiday in India, on December 25 each year.',' \'2020-12-25\''),(71,'New Year\'s Eve','New Yearâ€™s Eve is the last day of the year, December 31, in the Gregorian calendar.',' \'2020-12-31\'');
